import { useNavigate, useParams } from "react-router-dom";
import useFetch from './useFetch';


const Ex = () => {
    const {id } = useParams()
    const {workout} = useFetch('http://localhost:8001/workouts/' + id);
    const navigate = useNavigate();

    const handleClick = ()=>{
        fetch('http://localhost:8001/workouts/' + workout.id,
            {
                method: 'DELETE'
            }
        ).then(() =>{
            navigate('/');
        })
    }
    return ( <div className="Excersises">
            
           
            {workout && (
                
                <article>
                    <h2>{workout.date}</h2>
                    <h4> Workout type {workout.type}</h4>
                    <p> Excersise Name: {workout.excersises[0]}</p>
                    <p> Weight (lbs): {workout.excersises[1]}</p>
                    <p> Sets: {workout.excersises[2]}</p>
                    <p> Reps per Set: {workout.excersises[3]}</p>

                    <button onClick={handleClick}>delete</button>
                </article>
        )}

    </div>);
}
 
export default Ex;
